import logo from './logo.svg';
import './App.css';
import Header from './components/header'

function App() {
  return (
    <div className="App">
      <header/>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code>.
        </p>
    </div>
  );
}

export default App;
